// import Rails from 'rails-ujs'
Rails.start()

Rails.$("#deleteUser").on('click', function () {
    var id = Rails.$(this).parent.id();
    Rails.ajax({
        type:'DELETE',
        url: '/user/'+id,
        dataType : 'json',
        success:function(result){
             alert("Usuario borrado correctamente"); 
            }
    });
});
